0001	{"-- AISIS Scraper Schema for Supabase (PostgreSQL)\n-- Migration: Create initial tables\n\n-- Departments\nCREATE TABLE IF NOT EXISTS departments (\n  id SERIAL PRIMARY KEY,\n  code TEXT UNIQUE NOT NULL,\n  name TEXT NOT NULL,\n  created_at TIMESTAMPTZ DEFAULT NOW()\n)","-- Degree Programs\nCREATE TABLE IF NOT EXISTS degree_programs (\n  id SERIAL PRIMARY KEY,\n  code TEXT UNIQUE NOT NULL,\n  name TEXT NOT NULL,\n  is_honors BOOLEAN DEFAULT FALSE,\n  track TEXT,\n  specialization TEXT,\n  version_year INTEGER,\n  version_semester INTEGER,\n  created_at TIMESTAMPTZ DEFAULT NOW()\n)","-- Class Sections\nCREATE TABLE IF NOT EXISTS class_sections (\n  id TEXT PRIMARY KEY,  -- composite: term-subjectCode-section\n  subject_code TEXT NOT NULL,\n  section TEXT NOT NULL,\n  course_title TEXT NOT NULL,\n  units INTEGER DEFAULT 0,\n  instructor TEXT,\n  max_capacity INTEGER DEFAULT 0,\n  free_slots INTEGER DEFAULT 0,\n  lang TEXT,\n  level TEXT,\n  remarks TEXT,\n  has_prerequisites BOOLEAN DEFAULT FALSE,\n  term TEXT NOT NULL,\n  department TEXT NOT NULL,\n  scraped_at TIMESTAMPTZ DEFAULT NOW()\n)","-- Schedule Slots (for class sections)\nCREATE TABLE IF NOT EXISTS schedule_slots (\n  id SERIAL PRIMARY KEY,\n  class_section_id TEXT REFERENCES class_sections(id) ON DELETE CASCADE,\n  day TEXT NOT NULL,\n  start_time TEXT NOT NULL,\n  end_time TEXT NOT NULL,\n  room TEXT,\n  modality TEXT DEFAULT 'ONSITE'\n)","-- Curriculum Courses (courses in a degree program)\nCREATE TABLE IF NOT EXISTS curriculum_courses (\n  id SERIAL PRIMARY KEY,\n  degree_code TEXT REFERENCES degree_programs(code) ON DELETE CASCADE,\n  subject_code TEXT NOT NULL,\n  course_title TEXT NOT NULL,\n  units NUMERIC(3,1) DEFAULT 0,\n  prerequisites TEXT,\n  year INTEGER,\n  semester INTEGER,\n  created_at TIMESTAMPTZ DEFAULT NOW(),\n  UNIQUE(degree_code, subject_code)\n)","-- Courses Master (unique courses across all curricula)\nCREATE TABLE IF NOT EXISTS courses (\n  id SERIAL PRIMARY KEY,\n  cat_no TEXT UNIQUE NOT NULL,\n  title TEXT NOT NULL,\n  units NUMERIC(3,1) DEFAULT 0,\n  department TEXT,\n  created_at TIMESTAMPTZ DEFAULT NOW()\n)","-- Create indexes for common queries\nCREATE INDEX IF NOT EXISTS idx_class_sections_term ON class_sections(term)","CREATE INDEX IF NOT EXISTS idx_class_sections_department ON class_sections(department)","CREATE INDEX IF NOT EXISTS idx_class_sections_subject_code ON class_sections(subject_code)","CREATE INDEX IF NOT EXISTS idx_curriculum_courses_degree ON curriculum_courses(degree_code)","CREATE INDEX IF NOT EXISTS idx_schedule_slots_section ON schedule_slots(class_section_id)","-- Full-text search on courses\nCREATE INDEX IF NOT EXISTS idx_courses_fts ON courses USING GIN(to_tsvector('english', cat_no || ' ' || title))"}	initial_schema
0002	{"-- AISIS Scraper Schema v2 - Normalized with Integer Keys\n-- Migration: Drop old schema, create normalized tables\n\n-- ============================================\n-- DROP OLD TABLES (if migrating from v1)\n-- ============================================\nDROP TABLE IF EXISTS schedule_slots CASCADE","DROP TABLE IF EXISTS curriculum_courses CASCADE","DROP TABLE IF EXISTS class_sections CASCADE","DROP TABLE IF EXISTS courses CASCADE","DROP TABLE IF EXISTS degree_programs CASCADE","DROP TABLE IF EXISTS departments CASCADE","-- ============================================\n-- LOOKUP TABLES (Small, frequently joined)\n-- ============================================\n\n-- Departments\nCREATE TABLE departments (\n  id SERIAL PRIMARY KEY,\n  code TEXT UNIQUE NOT NULL,\n  name TEXT NOT NULL,\n  created_at TIMESTAMPTZ DEFAULT NOW()\n)","-- Academic Terms (2025-1, 2025-2, etc.)\nCREATE TABLE terms (\n  id SERIAL PRIMARY KEY,\n  code TEXT UNIQUE NOT NULL,  -- \\"2025-2\\"\n  year INTEGER NOT NULL,\n  semester INTEGER NOT NULL,  -- 1, 2, or 0 (summer)\n  created_at TIMESTAMPTZ DEFAULT NOW()\n)","-- Instructors (deduplicated teacher names)\nCREATE TABLE instructors (\n  id SERIAL PRIMARY KEY,\n  name TEXT UNIQUE NOT NULL,\n  department_id INTEGER REFERENCES departments(id),\n  created_at TIMESTAMPTZ DEFAULT NOW()\n)","-- Rooms (deduplicated room codes)\nCREATE TABLE rooms (\n  id SERIAL PRIMARY KEY,\n  code TEXT UNIQUE NOT NULL,  -- \\"SEC A 301\\"\n  building TEXT,              -- \\"SEC A\\"\n  room_number TEXT,           -- \\"301\\"\n  created_at TIMESTAMPTZ DEFAULT NOW()\n)","-- ============================================\n-- MASTER DATA TABLES\n-- ============================================\n\n-- Courses (unique course catalog)\nCREATE TABLE courses (\n  id SERIAL PRIMARY KEY,\n  course_code TEXT UNIQUE NOT NULL,  -- \\"CSCI 21\\", \\"MATH 101\\"\n  title TEXT NOT NULL,\n  units NUMERIC(3,1) DEFAULT 0,\n  department_id INTEGER REFERENCES departments(id),\n  created_at TIMESTAMPTZ DEFAULT NOW()\n)","-- Degree Programs\nCREATE TABLE degree_programs (\n  id SERIAL PRIMARY KEY,\n  code TEXT UNIQUE NOT NULL,  -- \\"BS CS_2024_1\\"\n  name TEXT NOT NULL,\n  is_honors BOOLEAN DEFAULT FALSE,\n  track TEXT,\n  specialization TEXT,\n  version_year INTEGER,\n  version_semester INTEGER,\n  created_at TIMESTAMPTZ DEFAULT NOW()\n)","-- ============================================\n-- RELATIONSHIP TABLES\n-- ============================================\n\n-- Curriculum: Which courses are in which degree programs\nCREATE TABLE curriculum_courses (\n  id SERIAL PRIMARY KEY,\n  degree_id INTEGER NOT NULL REFERENCES degree_programs(id) ON DELETE CASCADE,\n  course_id INTEGER NOT NULL REFERENCES courses(id) ON DELETE CASCADE,\n  year INTEGER,          -- 1-5\n  semester INTEGER,      -- 1, 2, or 0 (summer)\n  prerequisites_raw TEXT,  -- Raw prerequisite text for parsing\n  category TEXT,         -- \\"Core\\", \\"Elective\\", etc.\n  created_at TIMESTAMPTZ DEFAULT NOW(),\n  UNIQUE(degree_id, course_id)\n)","-- Class Sections (schedule offerings)\nCREATE TABLE class_sections (\n  id SERIAL PRIMARY KEY,\n  course_id INTEGER NOT NULL REFERENCES courses(id),\n  term_id INTEGER NOT NULL REFERENCES terms(id),\n  instructor_id INTEGER REFERENCES instructors(id),\n  department_id INTEGER REFERENCES departments(id),\n  section TEXT NOT NULL,       -- \\"A\\", \\"B-TH\\", etc.\n  max_capacity INTEGER DEFAULT 0,\n  free_slots INTEGER DEFAULT 0,\n  lang TEXT,\n  level TEXT,\n  remarks TEXT,\n  has_prerequisites BOOLEAN DEFAULT FALSE,\n  scraped_at TIMESTAMPTZ DEFAULT NOW(),\n  UNIQUE(course_id, term_id, section)\n)","-- Schedule Slots (time/room for each section)\nCREATE TABLE schedule_slots (\n  id SERIAL PRIMARY KEY,\n  section_id INTEGER NOT NULL REFERENCES class_sections(id) ON DELETE CASCADE,\n  room_id INTEGER REFERENCES rooms(id),\n  day TEXT NOT NULL,           -- \\"Monday\\", \\"Tuesday\\", etc.\n  start_time TIME NOT NULL,\n  end_time TIME NOT NULL,\n  modality TEXT DEFAULT 'ONSITE'  -- \\"ONSITE\\", \\"ONLINE\\", \\"HYBRID\\"\n)","-- ============================================\n-- INDEXES for fast lookups\n-- ============================================\n\n-- Lookup table indexes\nCREATE INDEX idx_instructors_name ON instructors(name)","CREATE INDEX idx_rooms_code ON rooms(code)","CREATE INDEX idx_courses_code ON courses(course_code)","CREATE INDEX idx_terms_code ON terms(code)","-- Foreign key indexes (for JOINs)\nCREATE INDEX idx_sections_course ON class_sections(course_id)","CREATE INDEX idx_sections_term ON class_sections(term_id)","CREATE INDEX idx_sections_instructor ON class_sections(instructor_id)","CREATE INDEX idx_sections_dept ON class_sections(department_id)","CREATE INDEX idx_curriculum_degree ON curriculum_courses(degree_id)","CREATE INDEX idx_curriculum_course ON curriculum_courses(course_id)","CREATE INDEX idx_slots_section ON schedule_slots(section_id)","CREATE INDEX idx_slots_room ON schedule_slots(room_id)","-- Full-text search on courses\nCREATE INDEX idx_courses_fts ON courses \n  USING GIN(to_tsvector('english', course_code || ' ' || title))","-- ============================================\n-- HELPER VIEWS for common queries\n-- ============================================\n\n-- Full section info with all lookups\nCREATE VIEW v_class_sections AS\nSELECT \n  cs.id,\n  c.course_code,\n  c.title as course_title,\n  c.units,\n  cs.section,\n  i.name as instructor,\n  d.code as department,\n  t.code as term,\n  cs.max_capacity,\n  cs.free_slots,\n  cs.has_prerequisites\nFROM class_sections cs\nJOIN courses c ON cs.course_id = c.id\nJOIN terms t ON cs.term_id = t.id\nLEFT JOIN instructors i ON cs.instructor_id = i.id\nLEFT JOIN departments d ON cs.department_id = d.id","-- Full curriculum with course details\nCREATE VIEW v_curriculum AS\nSELECT\n  dp.code as degree_code,\n  dp.name as degree_name,\n  c.course_code,\n  c.title as course_title,\n  c.units,\n  cc.year,\n  cc.semester,\n  cc.prerequisites_raw,\n  cc.category\nFROM curriculum_courses cc\nJOIN degree_programs dp ON cc.degree_id = dp.id\nJOIN courses c ON cc.course_id = c.id"}	normalize_schema
0003	{"-- Migration: AISIS Credentials Storage\n-- Uses Supabase Auth for user management\n-- Stores encrypted AISIS credentials per user\n\n-- Enable pgcrypto for encryption functions\nCREATE EXTENSION IF NOT EXISTS pgcrypto","-- AISIS credentials table (linked to auth.users)\nCREATE TABLE IF NOT EXISTS public.aisis_credential (\n  id UUID PRIMARY KEY DEFAULT gen_random_uuid(),\n  user_id UUID NOT NULL UNIQUE REFERENCES auth.users(id) ON DELETE CASCADE,\n  encrypted_username TEXT NOT NULL,\n  encrypted_password TEXT NOT NULL,\n  iv TEXT NOT NULL,  -- Initialization vector for AES decryption\n  auth_tag TEXT NOT NULL,  -- GCM authentication tag\n  linked_at TIMESTAMPTZ DEFAULT NOW(),\n  last_used_at TIMESTAMPTZ\n)","-- Index for fast user lookup\nCREATE INDEX IF NOT EXISTS idx_aisis_credential_user_id ON public.aisis_credential(user_id)","-- User preferences table\nCREATE TABLE IF NOT EXISTS public.user_preference (\n  id UUID PRIMARY KEY DEFAULT gen_random_uuid(),\n  user_id UUID NOT NULL UNIQUE REFERENCES auth.users(id) ON DELETE CASCADE,\n  default_term TEXT DEFAULT '2025-2',\n  language TEXT DEFAULT 'en',\n  theme TEXT DEFAULT 'dark',\n  created_at TIMESTAMPTZ DEFAULT NOW(),\n  updated_at TIMESTAMPTZ DEFAULT NOW()\n)","-- Personal data cache (scraped from AISIS, cached for performance)\nCREATE TABLE IF NOT EXISTS public.user_schedule_cache (\n  id UUID PRIMARY KEY DEFAULT gen_random_uuid(),\n  user_id UUID NOT NULL REFERENCES auth.users(id) ON DELETE CASCADE,\n  term TEXT NOT NULL,\n  schedule_data JSONB NOT NULL,\n  scraped_at TIMESTAMPTZ DEFAULT NOW(),\n  expires_at TIMESTAMPTZ DEFAULT NOW() + INTERVAL '24 hours',\n  UNIQUE(user_id, term)\n)","CREATE TABLE IF NOT EXISTS public.user_ips_cache (\n  id UUID PRIMARY KEY DEFAULT gen_random_uuid(),\n  user_id UUID NOT NULL REFERENCES auth.users(id) ON DELETE CASCADE,\n  ips_data JSONB NOT NULL,\n  scraped_at TIMESTAMPTZ DEFAULT NOW(),\n  expires_at TIMESTAMPTZ DEFAULT NOW() + INTERVAL '7 days'\n)","CREATE TABLE IF NOT EXISTS public.user_grades_cache (\n  id UUID PRIMARY KEY DEFAULT gen_random_uuid(),\n  user_id UUID NOT NULL REFERENCES auth.users(id) ON DELETE CASCADE,\n  term TEXT NOT NULL,\n  grades_data JSONB NOT NULL,\n  scraped_at TIMESTAMPTZ DEFAULT NOW(),\n  UNIQUE(user_id, term)\n)","-- RLS Policies (Row Level Security)\nALTER TABLE public.aisis_credential ENABLE ROW LEVEL SECURITY","ALTER TABLE public.user_preference ENABLE ROW LEVEL SECURITY","ALTER TABLE public.user_schedule_cache ENABLE ROW LEVEL SECURITY","ALTER TABLE public.user_ips_cache ENABLE ROW LEVEL SECURITY","ALTER TABLE public.user_grades_cache ENABLE ROW LEVEL SECURITY","-- Users can only access their own data\nCREATE POLICY \\"Users can view own credentials\\" ON public.aisis_credential\n  FOR SELECT USING (auth.uid() = user_id)","CREATE POLICY \\"Users can insert own credentials\\" ON public.aisis_credential\n  FOR INSERT WITH CHECK (auth.uid() = user_id)","CREATE POLICY \\"Users can update own credentials\\" ON public.aisis_credential\n  FOR UPDATE USING (auth.uid() = user_id)","CREATE POLICY \\"Users can delete own credentials\\" ON public.aisis_credential\n  FOR DELETE USING (auth.uid() = user_id)","-- Same for preferences\nCREATE POLICY \\"Users can manage own preferences\\" ON public.user_preference\n  FOR ALL USING (auth.uid() = user_id)","-- Same for cache tables\nCREATE POLICY \\"Users can manage own schedule cache\\" ON public.user_schedule_cache\n  FOR ALL USING (auth.uid() = user_id)","CREATE POLICY \\"Users can manage own IPS cache\\" ON public.user_ips_cache\n  FOR ALL USING (auth.uid() = user_id)","CREATE POLICY \\"Users can manage own grades cache\\" ON public.user_grades_cache\n  FOR ALL USING (auth.uid() = user_id)","-- Comment explaining security\nCOMMENT ON TABLE public.aisis_credential IS 'Stores encrypted AISIS credentials. Password is AES-256-GCM encrypted client-side before storage.'"}	user_aisis_credentials
0004	{"-- Chat Message Logging (Enhanced for AI Analysis)\n-- Stores conversation history with full-text search and structured metadata\n\nCREATE TABLE IF NOT EXISTS chat_message (\n  id UUID PRIMARY KEY DEFAULT gen_random_uuid(),\n  user_id UUID REFERENCES auth.users(id) ON DELETE CASCADE,\n  session_id TEXT NOT NULL,\n  role TEXT NOT NULL CHECK (role IN ('user', 'assistant', 'system')),\n  content TEXT NOT NULL,\n  \n  -- Structured data for analysis\n  tool_calls JSONB,  -- Array of {name, args, result}\n  intent TEXT,  -- Detected user intent (e.g., \\"schedule_query\\", \\"grade_check\\")\n  entities JSONB DEFAULT '[]',  -- Extracted entities: [{type: \\"course\\", value: \\"LLAW 113\\"}]\n  \n  -- Performance metrics\n  latency_ms INTEGER,  -- Response time in milliseconds\n  tokens_used INTEGER,  -- Tokens consumed\n  model TEXT DEFAULT 'gemini-2.0-flash',\n  \n  -- Timestamps\n  created_at TIMESTAMPTZ DEFAULT NOW(),\n  \n  -- Full-text search vector (auto-updated)\n  search_vector TSVECTOR GENERATED ALWAYS AS (\n    setweight(to_tsvector('english', coalesce(content, '')), 'A') ||\n    setweight(to_tsvector('english', coalesce(intent, '')), 'B')\n  ) STORED\n)","-- Indexes for efficient querying\nCREATE INDEX IF NOT EXISTS idx_chat_session ON chat_message(session_id, created_at)","CREATE INDEX IF NOT EXISTS idx_chat_user ON chat_message(user_id, created_at DESC)","CREATE INDEX IF NOT EXISTS idx_chat_intent ON chat_message(intent) WHERE intent IS NOT NULL","CREATE INDEX IF NOT EXISTS idx_chat_search ON chat_message USING GIN(search_vector)","CREATE INDEX IF NOT EXISTS idx_chat_entities ON chat_message USING GIN(entities)","-- Row Level Security\nALTER TABLE chat_message ENABLE ROW LEVEL SECURITY","-- Users can only access their own messages\nCREATE POLICY \\"users_own_messages\\" ON chat_message\n  FOR ALL USING (auth.uid() = user_id)","-- Allow anonymous sessions (null user_id) to be created\nCREATE POLICY \\"allow_anonymous_insert\\" ON chat_message\n  FOR INSERT WITH CHECK (user_id IS NULL OR auth.uid() = user_id)","-- View for analytics (aggregate stats)\nCREATE OR REPLACE VIEW chat_analytics AS\nSELECT \n  DATE(created_at) as date,\n  intent,\n  COUNT(*) as message_count,\n  AVG(latency_ms)::INTEGER as avg_latency_ms,\n  SUM(tokens_used) as total_tokens\nFROM chat_message\nWHERE role = 'assistant'\nGROUP BY DATE(created_at), intent\nORDER BY date DESC, message_count DESC","COMMENT ON TABLE chat_message IS 'Stores chat history with full-text search and AI-analyzable structure'","COMMENT ON COLUMN chat_message.intent IS 'Auto-detected user intent for categorization'","COMMENT ON COLUMN chat_message.entities IS 'Extracted entities like courses, instructors, sections'","COMMENT ON COLUMN chat_message.search_vector IS 'Full-text search index for content and intent'"}	chat_messages
0005	{"-- Add token_count column to chat_message table\n-- The code uses token_count but the original schema had tokens_used\n\nALTER TABLE chat_message\nADD COLUMN IF NOT EXISTS token_count INTEGER","-- Create index for token analytics\nCREATE INDEX IF NOT EXISTS idx_chat_token_count ON chat_message (token_count)\nWHERE\n    token_count IS NOT NULL","-- Update chat_analytics view to include token_count\nCREATE OR REPLACE VIEW chat_analytics AS\nSELECT \n  DATE(created_at) as date,\n  intent,\n  COUNT(*) as message_count,\n  AVG(latency_ms)::INTEGER as avg_latency_ms,\n  SUM(COALESCE(token_count, tokens_used)) as total_tokens\nFROM chat_message\nWHERE role = 'assistant'\nGROUP BY DATE(created_at), intent\nORDER BY date DESC, message_count DESC","COMMENT ON COLUMN chat_message.token_count IS 'Token count for this message'"}	add_token_count
